import React from 'react';
import classes from './catalogue.module.css';
import ProductCard from '../card/productCard';

function Catalogue(props) {
    return(
        <div className={classes.features}>
           <ProductCard />
           <ProductCard />
        </div>
    );
}

export default Catalogue;
